import React from 'react';
import './App.css';
import {Container, Grid, Box, Item} from '@mui/material';
import GunMovement from './components/GunMovement';
import CameraImagery from './components/CameraImagery';
import SearchBar from './components/SearchBar';

function App() {
  return (
    <Container maxWidth="sm">
      <Grid container direction="column" spacing={2}>
        <Grid item style={{ textAlign: 'center' }}>
          <h1>Auto-Aiming Coil Gun</h1>
        </Grid>
        {/* <Grid item container sx={{
          display: 'flex',
          justifyContent: 'center',
          width: '100%',
          p: 1,
          m: 1,
        }}>
          <SearchBar />
          <h3>test</h3>
        </Grid> */}
        <Box
          sx={{
            display: 'grid',
            gridAutoColumns: '1fr',
            gap: 1,
          }}
        >
          <Item sx={{ gridRow: '1', gridColumn: 'span 2' }}>
            <SearchBar />
          </Item>
          <Item sx={{ gridRow: '1', gridColumn: '4 / 5' }}>
            <h3>test</h3>
          </Item>
        </Box>
        <Grid item>
          <CameraImagery />
        </Grid>
        <Grid item>
          <GunMovement />
        </Grid>
      </Grid>
    </Container>
  );
}

export default App;
